/*
   ----------------------------------------------------------------------------
   INIZIO DEL CODICE
   ----------------------------------------------------------------------------
*/

void VoiceSystemInit (void)
{
    flite_init();
    VoiceObj = register_cmu_us_kal16 ();   
}                            

int ndMain()
{
    char NameOfTheRightCore [512];
    
    ndInitSystem (); 
    ndHAL_SwitchToFullScreenMode ();
    
    VoiceSystemInit ();
    
    if (ndINFO_HAL_GetValue (NDGET_ISPSPSLIM, 0, 0, 0))
    {
        ndIMG_LoadImageFromNDFArray (&MyImage, Nanodesktop_BA_newlogo_SLIMWidth, Nanodesktop_BA_newlogo_SLIMHeight, &(Nanodesktop_BA_newlogo_SLIM), NDMGKNB);
        ndLP_LoadWallPaperFromNDImage (&MyImage);
    
        strcpy (&NameOfTheRightCore, BA_CORE);                    
    }
    else
    {
        ndIMG_LoadImageFromNDFArray (&MyImage, Nanodesktop_BA_newlogo_FATWidth, Nanodesktop_BA_newlogo_FATHeight, &(Nanodesktop_BA_newlogo_FAT), NDMGKNB);
        ndLP_LoadWallPaperFromNDImage (&MyImage);
    
        strcpy (&NameOfTheRightCore, BA_CORE_FOR_FAT); 
    }
    
    flite_text_to_speech ("Blind Assistant loader started", VoiceObj, "play");
    
    if (fexist (NameOfTheRightCore))
    {
        // Questo riavvier il sistema e caricher il file core di BlindAssistant       
         ndHAL_SystemExec (NameOfTheRightCore);       
    }
    else    // Il file core non esiste
    {
        flite_text_to_speech ("Error: the Blind Assistant core doesn't exist", VoiceObj, "play");
        
        fprintf (stderr, "\n");
        fprintf (stderr, "The Blind Assistant core doesn't exist \n");
        fprintf (stderr, "\n");
        fprintf (stderr, "Check that the BA package has been \n");
        fprintf (stderr, "copied on Memory stick \n");
        
        ndDelay (10);
        ndHAL_SystemHalt (0);
    }
    
}



